import React from 'react';
import './ActualTab.css';

function LoginForm() {
    var login_form = (
        <form>
            <input className="input-style" placeholder="Name" type="text" />
            <input placeholder="Phone" type="number" />
        </form>
    );

    return login_form;
};

export default LoginForm;
